package maths2;

public class Else_if {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int k=88+33;
		if (k<55)
		{
			System.out.println("Pass");
		}
		else if (k>66)
		{
			System.out.println("Fail");
		}
		else
		{
			System.out.println("No Result");
			
		}
	}

}
